#[kernel]
pub fn generic<const N: usize>(a: [bool; N], b: [bool; N]) -> [bool; N] {
    let mut ret_value = [false; N];
    for i in 0..N {
        ret_value[i] = !(a[i] ^ b[i]);
    }
    ret_value
}


#[kernel]
pub fn kernel(a: [bool; 4], b: [bool; 4]) -> [bool; 4] {
    generic::<4>(a,b)
}
